--SOLUTION 1.CREATE BANK TABLE AND INSERT 100 RECORDS.

CREATE TABLE BANK (
    BANK_ID INT PRIMARY KEY,
    BANK_NAME VARCHAR(100) NOT NULL,
    BRANCH_NAME VARCHAR(100),
    ADDRESS VARCHAR(255),
    CITY VARCHAR(50),
    STATE VARCHAR(50),
    ZIP_CODE VARCHAR(10),
    IFSC_CODE VARCHAR(20) NOT NULL
);

