--SOLUTION 2.CREATE EMPLOYEE TABLE AND INSERT 2000 RECORDS.

CREATE TABLE EMPLOYEE (
    EMP_ID INT PRIMARY KEY,
    EMP_NAME VARCHAR(100) NOT NULL,
    DESIGNATION VARCHAR(50),
    SALARY NUMERIC(10,2),
    BANK_ID INT,
    FOREIGN KEY (BANK_ID) REFERENCES BANK(BANK_ID)
);
